import React, { Component } from "react";
import Sidebar from "./Sidebar";

class Home extends Component {
  constructor(props) {
    super(props);
    console.log(this.props.events)
  }

  render() {

    this.list = this.props.events.map(event => (
      <div key={event.database_id}>
        <h2>{event.title}</h2>
        <h3>{event.date}</h3>
      </div>
    ));
    return (
      <div>
        <Sidebar events={this.props.events} />
        <p>The home page!</p>
      </div>
    );
  }
}

export default Home;
